    html, body {
      height: 100%;
      margin: 0;
      font-family: Arial, sans-serif;
    }

    /* Full-screen loading overlay */
    #loading-screen {
      display: flex;
      flex-direction: column;
      justify-content: center;
      align-items: center;
      position: fixed;
      width: 100%;
      height: 100%;
   background: linear-gradient(to bottom right, #ad5a62, #ffffffE6); /* 90% */
      z-index: 9999;
      top: 0;
      left: 0;
    }

    /* Spinner style */
    .spinner {
      border: 7px solid #f3f3f3;
      border-top: 16px solid #a91523;
      border-radius: 50%;
      width: 70px;
      height: 70px;
      animation: spin 2s linear infinite;
    }


   .loading-message {
  margin-top: 40px;
  font-size: 18px;
  color: #ffffff;
  font-weight: 500;
  text-align: center;
  text-shadow: 1px 1px 4px rgba(0, 0, 0, 0.25);
  letter-spacing: 0.5px;
  animation: fadeIn 1.5s ease-in-out both;
}

   @keyframes fadeIn {
  0% {
    opacity: 0;
    transform: translateY(10px);
  }
  100% {
    opacity: 1;
    transform: translateY(0);
  }
}


    /* Spinner animation */
    @keyframes spin {
      0% { transform: rotate(0deg); }
      100% { transform: rotate(360deg); }
    }

    /* Optional loading message */
    .loading-message {
      margin-top: 40px;
      font-size: 18px;
      color: #ffffff;
      text-shadow: 1px 1px 3px rgba(0,0,0,0.2);
    }

    /* Optional placeholder structure for layout alignment */
    .fake-wrapper {
      max-width: 400px;
      margin: 60px auto;
      opacity: 0;
    }

    .fake-input,
    .fake-button,
    .fake-header {
      height: 40px;
      margin-bottom: 20px;
      border-radius: 4px;
      background-color: transparent;
      border: none;
    }
  </style>
</head>
